    }

    public int numeroPaginas()
    {
        int numeroBotones;
        int numeroRegistro = lista.Length;
        if (numeroRegistro % RegPag == 0)
        {
            numeroBotones = (numeroRegistro / RegPag);
        }
        else
        {
            numeroBotones = (numeroRegistro / RegPag) + 1;
        }
        return numeroBotones;


